"   <div id=\"basicsTopicLeft\">",
"    <div id=\"topicTitle\">",
"     Patient information: Familial hypercholesterolemia (The Basics)",
"    </div>",
"    <span class=\"view\">",
"     View in",
"     <a class=\"lang\" href=\"./es-419/familial-hypercholesterolemia-the-basics?source=topic_page\">",
"      Spanish",
"     </a>",
"    </span>",
"    <a class=\"contributor contributor_credentials\" href=\"./authors-and-editors/patient-information\">",
"     Written by the doctors and editors at UpToDate",
"    </a>",
"    <div id=\"topicText\">",
"     <p class=\"headingAnchor\" id=\"H9335631\">",
"      <span class=\"h1\">",
"       What is familial hypercholesterolemia?",
"      </span>",
"      &nbsp;&mdash;&nbsp;Familial hypercholesterolemia is a disorder that causes too much cholesterol and fat to build up in the body. When the cholesterol and fat build up inside the arteries in the heart, they can cause heart attacks. As a result, people with this disorder can have heart attacks at a very young age&mdash;sometimes even as children.",
"     </p>",
"     <p>",
"      Familial hypercholesterolemia, often called &ldquo;FH,&rdquo; is passed on in families. There are 2 main forms of the condition:",
"     </p>",
"     <p>",
"      <ul class=\"bullet-block\">",
"       <li>",
"        <strong>",
"         Heterozygous FH",
"        </strong>",
"        &ndash; In this form, a child gets the FH gene from just 1 parent.",
"       </li>",
"       <li>",
"        <strong>",
"         Homozygous FH",
"        </strong>",
"        &ndash; In this form, a child gets the FH gene from both parents. This form of FH is much more severe than the other. People with homozygous FH have very high levels of cholesterol. They have a very high risk of having heart attacks and dying young.",
"       </li>",
"      </ul>",
"     </p>",
"     <p class=\"headingAnchor\" id=\"H9335646\">",
"      <span class=\"h1\">",
"       What are the symptoms of FH?",
"      </span>",
"      &nbsp;&mdash;&nbsp;The most serious symptom of FH is a heart attack. But thanks to medicines, the rates of heart attacks in people with FH have dropped.",
"     </p>",
"     <p>",
"      FH can also cause firm, fatty deposits to form under the skin. These deposits are called &ldquo;xanthomas.&rdquo; They can form on different parts of the body, such as at the heel of the foot, around the knee or elbow, and around the eyes.",
"     </p>",
"     <p class=\"headingAnchor\" id=\"H9335669\">",
"      <span class=\"h1\">",
"       Is there a test for FH?",
"      </span>",
"      &nbsp;&mdash;&nbsp;Yes. Routine blood tests to measure cholesterol can show whether a person&rsquo;s cholesterol levels are unusually high. If so, the doctor or nurse can look further for a possible cause and can then find out if FH is the problem.",
"     </p>",
"     <p>",
"      Children should have routine cholesterol tests once around age 9 to 12 and again around age 17 to 21. Some children get tested younger if they have a parent with FH or if they show signs of FH, such as xanthomas.",
"     </p>",
"     <p class=\"headingAnchor\" id=\"H9335684\">",
"      <span class=\"h1\">",
"       How is FH treated?",
"      </span>",
"      &nbsp;&mdash;&nbsp;FH is usually treated with medicines called statins, which lower cholesterol. Some people also get other medicines to lower cholesterol. Plus, people with the most severe forms of FH need other special treatments.",
"     </p>",
"     <p>",
"      If you have FH, it&rsquo;s very important that you take your medicines every day as directed. If the medicines cause any problems, or if you cannot afford your medicines, talk to your doctor or nurse. He or she might have possible solutions for you to try. The medicines used to treat FH can keep you from having a heart attack and help you live longer.",
"     </p>",
"     <p>",
"      It&rsquo;s also important that you limit the amount of meat and fried foods you eat. The body converts these and other fatty foods into cholesterol, so you should avoid them if possible.",
"     </p>",
"     <p class=\"headingAnchor\" id=\"H9335699\">",
"      <span class=\"h1\">",
"       What if I want to get pregnant?",
"      </span>",
"      &nbsp;&mdash;&nbsp;Make sure you talk to your doctor before you start trying to get pregnant. He or she will need to check the condition of your heart to make sure pregnancy is safe. Plus, you will need to stop taking your FH medicines for at least 3 months before you start trying to get pregnant. That&rsquo;s because the medicines used to treat FH, including statins, can harm a baby. You should not take your FH medicines while you are pregnant or breastfeeding.",
"     </p>",
"     <p>",
"      Be aware that there is a good chance you will pass on your disorder to your baby. Before you start trying to get pregnant, you and your partner should meet with your doctor to learn about the possible risks to your baby.",
"     </p>",
"     <p class=\"headingAnchor\" id=\"H9335813\">",
"      <span class=\"h1\">",
"       What will my life be like?",
"      </span>",
"      &nbsp;&mdash;&nbsp;If you stay on your medicines, eat right, and do all the things your doctor recommends, you will greatly reduce your chances of having a heart attack. Even so, be aware that you have a high risk of heart attacks and strokes, so you should learn to recognize their symptoms (",
"      <a class=\"graphic graphic_figure graphicRef52579 \" href=\"UTD.htm?1/15/1268\">",
"       figure 1",
"      </a>",
"      and",
"      <a class=\"graphic graphic_figure graphicRef73487 \" href=\"UTD.htm?21/2/21542\">",
"       figure 2",
"      </a>",
"      ).",
"     </p>",
"     <p class=\"headingAnchor\" id=\"H9335714\">",
"      <span class=\"h1\">",
"       More on this topic",
"      </span>",
"     </p>",
"     <p>",
"      <a class=\"medical medical_basics\" href=\"UTD.htm?27/10/27809?source=see_link\">",
"       Patient information: Coronary heart disease (The Basics)",
"      </a>",
"      <br/>",
"      <a class=\"medical medical_basics\" href=\"UTD.htm?9/53/10068?source=see_link\">",
