"     Section Editor",
"    </a>",
"    <br/>",
"    <a class=\"contributor contributor_credentials\" href=\"UTD.htm?5/30/5607/contributors\">",
"     James K Stoller, MS, MD",
"    </a>",
"    <br/>",
