"   <div class=\"ttl\">",
"    Women's Health Initiative: Risk of heart disease",
"   </div>",
"   <div class=\"cntnt\" style=\"width: 385px; height: 372px; background-image: url(data:image/gif;base64,);\">",
"   </div>",
"   <div class=\"lgnd\">",
"    Kaplan-Meier estimates of cumulative hazard rates of CHD. In the Women's Health Initiative, combined estrogen-progestin therapy was associated with a significant increase in coronary events. CHD included nonfatal myocardial infarction and death due to CHD. The overall hazard ratio for CHD was 1.24 (nominal 95% CI, 1.00-1.54).",
"    <div class=\"footnotes\">",
"    </div>",
"    <div class=\"reference\">",
"     Data from: Manson JE, Hsia J, Johnson KC, et al. Estrogen plus progestin and the risk of coronary heart disease. N Engl J Med 2003; 349:523.",
"    </div>",
"   </div>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\" style=\"width: 480px\">",
"   <div class=\"ttl\">",
"    Estrogen therapy not beneficial for secondary prevention of coronary heart disease",
"   </div>",
"   <div class=\"cntnt\" style=\"width: 460px; height: 262px; background-image: url(data:image/gif;base64,);\">",
"   </div>",
"   <div class=\"lgnd\">",
"    Data from the HERS-II trial on the incidence of coronary heart disease events (death or nonfatal myocardial infarction) in 2763 postmenopausal women with a prior history of myocardial infarction or interventional procedure who were treated with combined hormone replacement therapy of placebo. There was no difference between the two groups. The curves are truncated at year 7 when less than half of the cohort remained in follow-up.",
"    <div class=\"footnotes\">",
"    </div>",
